import { Component } from 'react';
import './App.css';
import Todos from './components/Todos';

class App extends Component{
  state = {
    todos: [
      {
      id: 1,
      title: 'Take out trash',
      completed: false
    },
    {
      id: 2,
      title: 'Applications to do',
      completed: false
    },
    {
      id: 3,
      title: 'Interview at 6:30',
      completed: false
    }
  ]
  }
  render(){
  return (
    <div className="App">
      <Todos/>
    </div>
  );
}
}

export default App;
